import React, { useState } from 'react';

const JsonTable = () => {
  const [jsonData, setJsonData] = useState('');
  const [tableData, setTableData] = useState([]);
  const [copiedData, setCopiedData] = useState('');

  const parseJson = (data, prefix = '') => {
    try {
      const tableRows = [];
  
      const processObject = (obj, currentPath = '') => {
        Object.entries(obj).forEach(([key, value]) => {
          const path = currentPath ? `${currentPath}.${key}` : key;
  
          if (typeof value === 'object' && value !== null) {
            tableRows.push({
              stt: tableRows.length + 1,
              attribute: path,
              dataType: 'object', // You might want to customize this based on your needs
              description: '',
              required: 'N',
            });
  
            processObject(value, path); // Continue processing nested objects
          } else {
            tableRows.push({
              stt: tableRows.length + 1,
              attribute: `${prefix}.${path}`,
              dataType: typeof value,
              description: '',
              required: 'N',
            });
          }
        });
      };
      processObject(data, prefix);
      setTableData(tableRows);
    } catch (error) {
      console.error('Invalid JSON format', error);
      setTableData([]);
    }
  };
  

